import { Visibility, VisibilityOff } from "@mui/icons-material";
import {
  Box,
  Button,
  FormControl,
  IconButton,
  InputAdornment,
  InputLabel,
  LinearProgress,
  OutlinedInput,
  Stack,
  Typography,
} from "@mui/material";
import { styled } from "@mui/system";
import React, { useEffect, useState } from "react";
import data_borne from "./data_borne.json";

function AppBorneMulhouse1() {
  const [dataBorne, setDataBorne] = useState(data_borne);

  const MyBox = styled(Box)({
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  });

  function borneAvailable() {
    let e;
    if (dataBorne.propriety.available === true) {
      e = (
        <Typography variant="h3" sx={{ color: "green" }}>
          Disponible
        </Typography>
      );
    }
    if (dataBorne.propriety.available === false) {
      e = (
        <Typography variant="h3" sx={{ color: "red" }}>
          Indisponible
        </Typography>
      );
    }
    return e;
  }

  const [progressBar, setprogressBar] = useState(1);

  const [etat, setEtat] = useState("login");
  const [values, setValues] = useState({
    email: "",
    password: "",
    showPassword: false,
  });

  const handleChange = (prop) => (event) => {
    setValues({ ...values, [prop]: event.target.value });
  };

  const handleClickShowPassword = () => {
    setValues({
      ...values,
      showPassword: !values.showPassword,
    });
  };

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };

  const handleForm = (e) => {
    e.preventDefault();
    console.log(values);
  };

  const handleClickValidate = () => {
    setDataBorne(data_borne);
    const requestOptions = {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(dataBorne),
    };
    fetch(
      `http://151.80.137.77:1880/mulhouse/borne_1/login/data_borne.json`,
      requestOptions
    ).then((response) =>
      response.json().then((dataBorne) => setDataBorne(dataBorne))
    );
  };

  useEffect(() => {
    function isAvailable() {
      if (dataBorne.propriety.available === false) {
        console.log("je vais au HOME");
        setprogressBar(20);
        //validateAlert();

        //navigate("/", { replace: true });
      }
    }
    isAvailable();
  }, []);

  function myLogin() {
    if (etat === "login") {
      return (
        <Stack spacing={2}>
          <FormControl
            onSubmit={handleForm}
            sx={{ display: "flex", flexWrap: "wrap" }}
            variant="outlined"
          >
            <InputLabel id="outlined-input" label="Email" type="email" required>
              Email
            </InputLabel>
            <OutlinedInput
              required
              id="outlined-adornment-email"
              label="email"
              value={values.email}
              onChange={handleChange("email")}
            />
          </FormControl>
          <FormControl
            onSubmit={handleForm}
            sx={{
              display: "flex",
              flexWrap: "wrap",
            }}
            variant="outlined"
          >
            <InputLabel
              required
              id="outlined-password-input"
              label="Password"
              type="password"
              autoComplete="current-password"
            >
              Password
            </InputLabel>
            <OutlinedInput
              id="outlined-adornment-password"
              type={values.showPassword ? "text" : "password"}
              value={values.password}
              onChange={handleChange("password")}
              endAdornment={
                <InputAdornment position="end">
                  <IconButton
                    aria-label="toggle password visibility"
                    onClick={handleClickShowPassword}
                    onMouseDown={handleMouseDownPassword}
                    edge="end"
                  >
                    {values.showPassword ? <VisibilityOff /> : <Visibility />}
                  </IconButton>
                </InputAdornment>
              }
              label="Password"
            />
          </FormControl>
          <Button
            variant="contained"
            onClick={() => {
              data_borne.login.email = values.email;
              data_borne.login.password = values.password;
              handleClickValidate();
            }}
          >
            Valider
          </Button>
        </Stack>
      );
    }
  }

  return (
    <>
      <MyBox>
        <Typography variant="h2">Borne 1 - Mulhouse</Typography>
      </MyBox>

      <MyBox>{borneAvailable()}</MyBox>
      <MyBox>
        <LinearProgress
          variant="determinate"
          sx={{
            m: 2,
            width: "80%",
            height: 10,
            borderRadius: 5,
          }}
          value={progressBar}
        />
      </MyBox>
      <MyBox sx={{ boxShadow: 3, borderRadius: 1 }}>{myLogin()}</MyBox>
    </>
  );
}

export default AppBorneMulhouse1;
